import React from "react";
import {
    BrowserRouter as Router,
    Routes,
    Route
} from "react-router-dom"
import Principal from "../Componentes";
import Departamentos from "../Componentes/Departamentos";
import Proreitorias from "../Componentes/Proreitorias";
import Unidades from "../Componentes/Unidades";

export default function Rotas(){
    return(
        <Router>
            <Routes>
                <Route path="/" element={<Principal />}/>
                <Route path="/unidades" element={<Unidades />}/>
                <Route path="/proreitorias" element={<Proreitorias />}/>
                <Route path="/departamentos" element={<Departamentos />}/>
            </Routes>
        </Router>
    );
}
